import React from 'react';
import './Date.css';
import { doc, onSnapshot } from "firebase/firestore";
import { db } from '../../firebase';
import moment from 'moment';

// Return Date now Component 
export default function ReturndAshdAte() {
 const [now, setNow] = React.useState(null);

 React.useEffect(async () => {
  await onSnapshot(doc(db, "muunganomoney", "money"), (doc) => {
   setNow(doc.data().delay);
  });

 }, []);

 return (
  <div className='wrp-date-trade-dash'>
   <h2>Date</h2>
   <p>{moment(now).format('llll')}</p>
  </div>
 );
};
